import React from 'react'


const Header = (props) => {
  return(
    <header className="header">
        <nav className='headerMenu'>
            <a href='#'>Home</a>
            <a href='#'>Contac Us</a>
            <a href='#'>About Us</a>
        </nav>
    </header>
   )

 }

export default Header
